INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("春咲 ひより", 1.4, "お！\nあそこに困ってそうな人発見！", 1, 1001, 0, 2, 0, 0, 0, 1, 0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("草野 優衣", 1.4, "大切な人を\n守れるようになりたい…って", 1, 1002, 0, 2, 0, 0, 0, 1, 0, 1, "みんなみたいに\nわたしも強くならなきゃ", "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("士条 怜", 1.4, "キミに必要な集中力と感性が", 1, 1003, 0, 2, 0, 0, 0, 1, 0, 1, "フェンシングを始めてみては？", "少しは磨かれると思いますよ。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("穂高 みそぎ", 1.5, "今日はなにして遊ぶ？", 1, 1004, 0, 2, 0, 0, 0, 1, 0, 1, "ねぇ、にいちゃん！", "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("風宮 あかり", 1.4, "ねぇ…", 1, 1006, 0, 2, 0, 0, 0, 1, 0, 1, "風宮あかりです", "私といっしょに…\nいかない？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("出雲 宮子", 1.5, "プリンたべたいのー", 1, 1007, 0, 2, 0, 0, 0, 1, 0, 1, "出雲宮子なのー", "食べ物の恨みは怖いのー");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("虹村 雪", 1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 1008, 0, 2, 0, 0, 0, 1, 0, 1, "ボクは虹村雪。", "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("柊杏奈", 1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 1009, 0, 2, 0, 0, 0, 1, 0, 1, "フッ…聞いて後悔するがいい！", "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("姫宮 真歩", 1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 1010, 0, 2, 0, 0, 0, 1, 0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", "ほんまおおきにやわ～♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("衣之咲 璃乃", 1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 1011, 0, 2, 0, 0, 0, 1, 0, 1, "衣之咲璃乃です！", "ここで会ったが\n100年目～！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("柏崎 初音", 1.4, "ち、超能力って…\n何のことかな～？", 1, 1012, 0, 2, 0, 0, 0, 1, 0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("美波 鈴奈", 1.4, "一応カリスマ読モJKやってまっす！", 1, 1016, 0, 2, 0, 0, 0, 1, 0, 1, "ちょす！\n美波鈴奈だよ～♪", "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("喜屋武 香織", 1.4, "東京は遊園地みたいなところさー", 1, 1017, 0, 2, 0, 0, 0, 1, 0, 1, "はいたーい。\n喜屋武香織さー。", "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("支倉 伊緒", 1.4, "先生って呼ばれるのは\nくすぐったいから", 1, 1018, 0, 2, 0, 0, 0, 1, 0, 1, "支倉伊緒です。", "イオちゃんって呼んでね。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("茜 ミミ", 1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 1020, 0, 2, 0, 0, 0, 1, 0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "ミミをおいてかないでぇ～");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("栗林 くるみ", 1.5, "あの……\nふぇ……", 1, 1021, 0, 2, 0, 0, 0, 1, 0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", "ふぇぇぇぇぇん……");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("風宮 より", 1.4, "こんな私に貴重な時間を\n割いていただき、", 1, 1022, 0, 2, 0, 0, 0, 1, 0, 1, "風宮よりです。\nあああああ！", "なんてありがとうございます！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("北条 綾音", 1.5, "おにいちゃんどこいくの？\nえ？", 1, 1023, 0, 2, 0, 0, 0, 1, 0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("天野 すずめ", 1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 1025, 0, 2, 0, 0, 0, 1, 0, 1, "わっ…わっ…私、\n天野すずめといいます！", "これて何か違う…\nあああすみません！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("倉石 恵理子", 1.4, "あなたは…運命の……\n伴侶……", 1, 1027, 0, 2, 0, 0, 0, 1, 0, 1, "……クスクス…私は\n…倉石恵理子……", "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("佐々木 咲恋", 1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 1028, 0, 2, 0, 0, 0, 1, 0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "…そうでしょ？？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("桜井 望", 1.4, "ぇっと…\nキミ、私のこと知らないの?!", 1, 1029, 0, 2, 0, 0, 0, 1, 0, 1, "桜井望だよ！\nよろしくねっ", "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ニノン・ジュベール", 1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 1030, 0, 2, 0, 0, 0, 1, 0, 1, "デケデケデンっ！", "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("上喜 しのぶ", 1.4, "でもって私の隣にいるのが……\nえ、見えない？", 1, 1031, 0, 2, 0, 0, 0, 1, 0, 1, "上喜しのぶです。\n手元のドクロが父です。", "おかしいですね……");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("野戸まひる", 1.5, "けんども\nそれには足りないモンが…", 1, 1033, 0, 2, 0, 0, 0, 1, 0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("綾瀬 ゆかり", 1.4, "ちょっと緊張しちゃって…", 1, 1034, 0, 2, 0, 0, 0, 1, 0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("氷川 鏡華", 1.5, "知らない人とは話しちゃいけないので", 1, 1036, 0, 2, 0, 0, 0, 1, 0, 1, "氷川鏡華…です", "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("柏崎 栞", 1.4, "……あ、アラーム。", 1, 1038, 0, 2, 0, 0, 0, 1, 0, 1, "柏崎…栞です。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("双葉 碧", 1.4, "私、一人も友達がいなくて……", 1, 1040, 0, 2, 0, 0, 0, 1, 0, 1, "ふ、双葉碧です。", "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("三角 千歌", 1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 1042, 0, 2, 0, 0, 0, 1, 0, 1, "三角千歌です。", "そう思っています。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("安芸 真琴", 1.4, "あぁ？\nお前のそいつの仲間か？", 1, 1043, 0, 2, 0, 0, 0, 1, 0, 1, "安芸真琴だ。", "う、疑ってすまなかったな…");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("イリヤ・オーンスタイン", 1.4, "生けとし生ける全ての者よ！", 1, 1044, 0, 2, 0, 0, 0, 1, 0, 1, "わらわこそは夜を総べる者！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("遠見 空花", 1.4, "ぐふふふふ……はっ！", 1, 1045, 0, 2, 0, 0, 0, 1, 0, 1, "そこで騎士は妖精を乱暴に……", "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("宮坂たまき", 1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 1046, 0, 2, 0, 0, 0, 1, 0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("大神 美冬", 1.4, "それでは早速クエストに…", 1, 1048, 0, 2, 0, 0, 0, 1, 0, 1, "大神美冬よ！", "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("星野静流", 1.4, "クエストもバトルも\n掃除も洗濯も", 1, 1049, 0, 2, 0, 0, 0, 1, 0, 1, "星野静流だよ！", "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("玉泉美咲", 1.5, "見ての通りの\nセクシー美少女で", 1, 1050, 0, 2, 0, 0, 0, 1, 0, 1, "アタシは玉泉美咲。", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("リマ", 1.4, "？？？？", 1, 1052, 0, 2, 0, 0, 0, 1, 0, 1, "？？？", "？？？？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("モニカ・ヴァイスヴィント", 1.5, "菓子でつろうなどと\n稚拙な策を……", 1, 1053, 0, 2, 0, 0, 0, 1, 0, 1, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ペコリーヌ", 1.5, "菓子でつろうなどと\n稚拙な策を……", 1, 1058, 0, 2, 0, 0, 0, 1, 0, 1, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("コッコロ", 1.5, "菓子でつろうなどと\n稚拙な策を……", 1, 1059, 0, 2, 0, 0, 0, 1, 0, 1, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("キャル", 1.5, "菓子でつろうなどと\n稚拙な策を……", 1, 1060, 0, 2, 0, 0, 0, 1, 0, 1, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる");
